    // 创建UI界面
    function createUI() {
        // 如果面板已存在，先移除
        const oldPanel = document.getElementById('torSimulationPanel');
        if (oldPanel) {
            oldPanel.remove();
        }

        // 创建主面板
        const panel = document.createElement('div');
        panel.id = 'torSimulationPanel';
        panel.style.left = `${config.panel.x}px`;
        panel.style.top = `${config.panel.y}px`;
        panel.style.width = `${config.panel.width}px`;
        panel.style.height = `${config.panel.height}px`;

        if (config.panel.visible) {
            panel.style.display = 'flex';
        }

        // 添加主题类
        if (config.session.theme === 'light') {
            panel.classList.add('light-theme');
        }

        // 面板头部（支持拖动）
        const header = document.createElement('div');
        header.className = 'panel-header';
        if (config.session.theme === 'light') {
            header.classList.add('light-theme');
        }
        header.id = 'panelHeader';

        const title = document.createElement('div');
        title.className = 'panel-title';
        title.textContent = 'Quasty v1.3';
        header.appendChild(title);

        // 面板控制按钮
        const controls = document.createElement('div');
        controls.className = 'panel-controls';

        // 最小化按钮
        const minimizeBtn = document.createElement('button');
        minimizeBtn.className = 'panel-btn';
        minimizeBtn.innerHTML = '−';
        minimizeBtn.title = 'Minimize';
        minimizeBtn.addEventListener('click', function() {
            toggleMinimize();
        });
        controls.appendChild(minimizeBtn);

        // 最大化按钮
        const maximizeBtn = document.createElement('button');
        maximizeBtn.className = 'panel-btn maximize-btn';
        maximizeBtn.innerHTML = '□';
        maximizeBtn.title = 'Maximize';
        maximizeBtn.addEventListener('click', function() {
            toggleMaximize();
        });
        controls.appendChild(maximizeBtn);

        // 关闭按钮 - 模仿上一版本的关闭方式
        const closeBtn = document.createElement('button');
        closeBtn.className = 'panel-btn close-btn';
        closeBtn.innerHTML = '×';
        closeBtn.title = 'Close';
        closeBtn.addEventListener('click', function() {
            togglePanel();
        });
        controls.appendChild(closeBtn);

        header.appendChild(controls);
        panel.appendChild(header);

        // 面板内容
        const content = document.createElement('div');
        content.className = 'panel-content';

        // 标签导航
        const tabs = document.createElement('div');
        tabs.className = 'panel-tabs';
        if (config.session.theme === 'light') {
            tabs.classList.add('light-theme');
        }

        // 标签按钮
        const tabButtons = [
            { id: 'dashboard', label: 'Dashboard' },
            { id: 'tor-simulation', label: 'TOR Simulation' },
            { id: 'network-monitor', label: 'Network Monitor' },
            { id: 'data-inspection', label: 'Data Inspection' },
            { id: 'privacy-tools', label: 'Privacy Tools' },
            { id: 'brute-force', label: 'Brute Force' },
            { id: 'settings', label: 'Settings' }
        ];

        tabButtons.forEach(tab => {
            const button = document.createElement('button');
            button.className = `tab-button ${tab.id === config.session.activeTab ? 'active' : ''}`;
            if (config.session.theme === 'light') {
                button.classList.add('light-theme');
            }
            button.textContent = tab.label;
            button.dataset.tab = tab.id;
            button.addEventListener('click', function() {
                switchTab(this.dataset.tab);
            });
            tabs.appendChild(button);
        });

        content.appendChild(tabs);

        // 标签内容区域
        const tabContent = document.createElement('div');
        tabContent.className = 'tab-content';

        // 仪表板标签
        const dashboardTab = createDashboardTab();
        tabContent.appendChild(dashboardTab);

        // TOR模拟标签
        const torSimulationTab = createTorSimulationTab();
        tabContent.appendChild(torSimulationTab);

        // 网络监控标签
        const networkMonitorTab = createNetworkMonitorTab();
        tabContent.appendChild(networkMonitorTab);

        // 数据检查标签
        const dataInspectionTab = createDataInspectionTab();
        tabContent.appendChild(dataInspectionTab);

        // 隐私工具标签
        const privacyToolsTab = createPrivacyToolsTab();
        tabContent.appendChild(privacyToolsTab);

        // 暴力破解标签
        const bruteForceTab = createBruteForceTab();
        tabContent.appendChild(bruteForceTab);

        // 设置标签
        const settingsTab = createSettingsTab();
        tabContent.appendChild(settingsTab);

        content.appendChild(tabContent);
        panel.appendChild(content);

        // 添加到页面
        document.body.appendChild(panel);

        // 设置拖动功能
        setupDragAndDrop();
    }

    // 设置面板拖动功能
    function setupDragAndDrop() {
        const panel = document.getElementById('torSimulationPanel');
        const header = document.getElementById('panelHeader');

        let isDragging = false;
        let offsetX, offsetY;

        // 鼠标按下时开始拖动
        header.addEventListener('mousedown', function(e) {
            // 如果是最大化状态，不允许拖动
            if (config.panel.maximized) return;

            isDragging = true;

            // 计算鼠标位置与面板左上角的偏移
            offsetX = e.clientX - panel.offsetLeft;
            offsetY = e.clientY - panel.offsetTop;

            // 改变鼠标样式
            document.body.style.cursor = 'move';
        });

        // 鼠标移动时拖动面板
        document.addEventListener('mousemove', function(e) {
            if (!isDragging) return;

            // 计算新位置
            const x = e.clientX - offsetX;
            const y = e.clientY - offsetY;

            // 限制在窗口内
            const maxX = window.innerWidth - panel.offsetWidth;
            const maxY = window.innerHeight - 30; // 留出一点空间

            const constrainedX = Math.max(0, Math.min(x, maxX));
            const constrainedY = Math.max(0, Math.min(y, maxY));

            // 应用新位置
            panel.style.left = `${constrainedX}px`;
            panel.style.top = `${constrainedY}px`;

            // 更新配置
            config.panel.x = constrainedX;
            config.panel.y = constrainedY;
            saveConfig();
        });

        // 鼠标释放时停止拖动
        document.addEventListener('mouseup', function() {
            if (isDragging) {
                isDragging = false;
                document.body.style.cursor = '';
            }
        });

        // 窗口失去焦点时停止拖动
        document.addEventListener('mouseleave', function() {
            if (isDragging) {
                isDragging = false;
                document.body.style.cursor = '';
            }
        });
    }

    // 切换面板显示/隐藏
    function togglePanel() {
        const panel = document.getElementById('torSimulationPanel');
        if (!panel) {
            createUI();
            return;
        }

        config.panel.visible = !config.panel.visible;

        if (config.panel.visible) {
            panel.style.display = 'flex';
            addToLog('Panel opened', 'info');
        } else {
            panel.style.display = 'none';
            addToLog('Panel closed', 'info');
        }

        saveConfig();
    }

    // 切换最大化/还原
    function toggleMaximize() {
        const panel = document.getElementById('torSimulationPanel');
        const maximizeBtn = document.querySelector('.maximize-btn');

        if (config.panel.maximized) {
            // 还原
            panel.style.width = `${config.panel.width}px`;
            panel.style.height = `${config.panel.height}px`;
            panel.style.left = `${config.panel.x}px`;
            panel.style.top = `${config.panel.y}px`;
            maximizeBtn.innerHTML = '□';
            config.panel.maximized = false;
        } else {
            // 最大化
            // 保存当前尺寸和位置
            config.panel.width = panel.offsetWidth;
            config.panel.height = panel.offsetHeight;
            config.panel.x = panel.offsetLeft;
            config.panel.y = panel.offsetTop;

            // 应用最大化尺寸
            panel.style.width = '90%';
            panel.style.height = '90%';
            panel.style.left = '5%';
            panel.style.top = '5%';
            maximizeBtn.innerHTML = '◻';
            config.panel.maximized = true;
        }

        saveConfig();
    }

    // 切换最小化/还原 - 修复了语法错误
    function toggleMinimize() {
        const panel = document.getElementById('torSimulationPanel');
        const content = panel.querySelector('.panel-content');
        const minimizeBtn = panel.querySelector('.panel-btn:not(.close-btn):not(.maximize-btn)');

        if (content.style.display === 'none') {
            // 还原
            content.style.display = 'flex';
            panel.style.height = `${config.panel.height}px`;
            minimizeBtn.innerHTML = '−';
        } else {
            // 最小化
            // 保存当前高度
            config.panel.height = panel.offsetHeight;
            panel.style.height = '40px';
            content.style.display = 'none';
            minimizeBtn.innerHTML = '+'; // 修复了此处的中文分号错误
            saveConfig();
        }
    }

    // 切换标签
    function switchTab(tabId) {
        // 更新活动标签按钮
        document.querySelectorAll('.tab-button').forEach(btn => {
            btn.classList.remove('active');
            if (btn.dataset.tab === tabId) {
                btn.classList.add('active');
            }
        });

        // 更新活动标签内容
        document.querySelectorAll('.tab-pane').forEach(pane => {
            pane.classList.remove('active');
            if (pane.id === `${tabId}-tab`) {
                pane.classList.add('active');
            }
        });

        // 保存活动标签
        config.session.activeTab = tabId;
        saveConfig();
    }

