    // ==============================================
    // 网络捕获功能
    // ==============================================
    function startNetworkCapture() {
        // 重写fetch和XMLHttpRequest以捕获网络请求
        if (window._originalFetch) return;

        // 保存原始函数
        window._originalFetch = window.fetch;
        window._originalXhrOpen = XMLHttpRequest.prototype.open;

        // 重写fetch
        window.fetch = async function(input, init) {
            const url = typeof input === 'string' ? input : input.url;
            const method = (init && init.method) || 'GET';

            try {
                const startTime = Date.now();
                const response = await window._originalFetch(input, init);

                // 记录请求
                logNetworkRequest(url, method, response.statusText, response.status);

                return response;
            } catch (error) {
                // 记录错误
                logNetworkRequest(url, method, error.message, 'ERROR');
                throw error;
            }
        };

        // 重写XMLHttpRequest
        XMLHttpRequest.prototype.open = function(method, url) {
            // 保存原始函数
            const originalSend = this.send;

            // 重写send方法
            this.send = function() {
                // 监听请求完成
                this.addEventListener('load', function() {
                    logNetworkRequest(url, method, this.statusText, this.status);
                });

                this.addEventListener('error', function() {
                    logNetworkRequest(url, method, 'Error', 'ERROR');
                });

                // 调用原始send方法
                originalSend.apply(this, arguments);
            };

            // 调用原始open方法
            window._originalXhrOpen.apply(this, arguments);
        };

        addToLog('Network capture started', 'success');
    }

    function stopNetworkCapture() {
        // 恢复原始函数
        if (window._originalFetch) {
            window.fetch = window._originalFetch;
            window._originalFetch = null;
        }

        if (window._originalXhrOpen) {
            XMLHttpRequest.prototype.open = window._originalXhrOpen;
            window._originalXhrOpen = null;
        }

        addToLog('Network capture stopped', 'info');
    }

    function logNetworkRequest(url, method, statusText, status) {
        // 检查是否应该拦截这个请求
        const isBlocked = config.features.adBlocker && shouldBlock(url);

        // 创建日志条目
        const logEntry = {
            timestamp: new Date().toISOString(),
            url: url,
            method: method,
            status: isBlocked ? 'BLOCKED' : `${status} ${statusText}`,
            type: isBlocked ? 'warning' : (status >= 400 ? 'error' : 'info')
        };

        // 添加到日志
        config.network.captureLog.unshift(logEntry); // 添加到开头

        // 如果是被拦截的请求，增加计数
        if (isBlocked) {
            config.network.blockedRequests++;
        }

        // 确保日志不超过最大限制
        trimLogs();

        // 保存配置
        saveConfig();

        // 更新显示
        updateCaptureDisplay();
        updateDashboardStats();
    }

    function updateCaptureDisplay() {
        const container = document.getElementById('capture-log');
        if (!container) return;

        container.innerHTML = '';

        if (config.network.captureLog.length === 0) {
            container.innerHTML = '<div class="log-entry log-info">No captured requests</div>';
            return;
        }

        config.network.captureLog.forEach(log => {
            const entry = document.createElement('div');
            entry.className = `log-entry log-${log.type}`;
            entry.innerHTML = `
                <span class="log-time">[${new Date(log.timestamp).toLocaleTimeString()}]</span>
                ${log.method} ${log.url} <strong>${log.status}</strong>
            `;
            container.appendChild(entry);
        });
    }

