    function checkTrackingElements() {
        const container = document.getElementById('tracking-elements-container');
        if (!container) return;

        // 常见的跟踪元素和属性
        const trackingAttributes = ['data-tracking', 'data-analytics', 'data-ga', 'data-gtm', 'data-facebook'];
        const trackingClasses = ['tracking', 'analytics', 'ga', 'gtm', 'facebook-pixel', 'adwords'];
        const trackingTags = ['script', 'img', 'iframe'];

        let trackingElements = [];

        // 搜索具有跟踪属性的元素
        trackingAttributes.forEach(attr => {
            document.querySelectorAll(`[${attr}]`).forEach(el => {
                trackingElements.push({
                    type: `Attribute: ${attr}`,
                    tag: el.tagName.toLowerCase(),
                    src: el.src || el.href || 'N/A'
                });
            });
        });


        // 搜索具有跟踪类的元素
        trackingClasses.forEach(cls => {
            document.querySelectorAll(`.${cls}`).forEach(el => {
                trackingElements.push({
                    type: `Class: ${cls}`,
                    tag: el.tagName.toLowerCase(),
                    src: el.src || el.href || 'N/A'
                });
            });
        });

        // 搜索来自已知跟踪域的资源
        const trackingDomains = [
            'google-analytics.com', 'googletagmanager.com', 'facebook.com',
            'doubleclick.net', 'adroll.com', 'segment.com', 'mixpanel.com',
            'hotjar.com', 'clicktale.net', 'optimizely.com'
        ];

        trackingTags.forEach(tag => {
            document.querySelectorAll(tag).forEach(el => {
                const src = el.src || el.href || '';
                if (src) {
                    for (const domain of trackingDomains) {
                        if (src.includes(domain)) {
                            trackingElements.push({
                                type: `Tracking Domain: ${domain}`,
                                tag: tag,
                                src: src
                            });
                            break;
                        }
                    }
                }
            });
        });

        // 去重
        trackingElements = [...new Map(trackingElements.map(item => [item.src, item])).values()];

        if (trackingElements.length === 0) {
            container.innerHTML = '<div class="log-entry log-success">No tracking elements detected</div>';
        } else {
            let content = `<div class="data-section-title">${trackingElements.length} Tracking Elements Detected</div>`;

            trackingElements.slice(0, 10).forEach(el => {
                content += `
                    <div class="data-item">
                        <span class="data-key">${el.tag} (${el.type})</span>
                        <span style="word-break: break-all;">${el.src}</span>
                    </div>
                `;
            });

            if (trackingElements.length > 10) {
                content += `<div class="log-entry log-info">+ ${trackingElements.length - 10} more elements</div>`;
            }

            container.innerHTML = content;
        }
    }

