    function shouldBlock(url) {
        // 广告和跟踪器域名列表
        const adDomains = [
            'doubleclick.net', 'googleadservices.com', 'googlesyndication.com',
            'adnxs.com', 'adservice.google.com', 'ads.yahoo.com',
            'servedbyadbutler.com', 'adroll.com', 'rubiconproject.com',
            'openx.net', 'revcontent.com', 'outbrain.com', 'taboola.com'
        ];

        // 广告路径模式
        const adPaths = [
            '/ad/', '/ads/', '/banner/', '/impression/', '/track/',
            '/tracking/', '/analytics/', '/pixel/', '/stats/'
        ];

        try {
            const urlObj = new URL(url);

            // 检查域名
            for (const domain of adDomains) {
                if (urlObj.hostname.includes(domain)) {
                    return true;
                }
            }

            // 检查路径
            for (const path of adPaths) {
                if (urlObj.pathname.includes(path)) {
                    return true;
                }
            }

            // 检查文件类型
            const ext = urlObj.pathname.split('.').pop().toLowerCase();
            if (['gif', 'png', 'jpg', 'jpeg', 'webp'].includes(ext) &&
                (urlObj.searchParams.has('ad') || urlObj.searchParams.has('banner'))) {
                return true;
            }

            return false;
        } catch (e) {
            return false;
        }
    }

