    function initUrlCleaner() {
        // 检查当前URL是否需要清理
        const currentUrl = window.location.href;
        const cleanedUrl = cleanUrl(currentUrl);

        if (currentUrl !== cleanedUrl) {
            addToLog('URL contains tracking parameters', 'info');

            // 如果启用了自动清理，直接跳转
            const autoClean = document.getElementById('auto-clean-urls');
            if (autoClean && autoClean.checked) {
                window.location.href = cleanedUrl;
            }
        }
    }

    function cleanUrl(url) {
        try {
            const urlObj = new URL(url);

            // 常见的跟踪参数列表
            const paramsToRemove = [
                'utm_source', 'utm_medium', 'utm_campaign', 'utm_term', 'utm_content',
                'fbclid', 'gclid', 'msclkid', 'mc_eid', 'mtm_source',
                'mtm_medium', 'mtm_campaign', 'mtm_content', 'mtm_term',
                'pk_campaign', 'pk_kwd', 'pk_medium', 'pk_source',
                'fb_action_ids', 'fb_action_types', 'fb_ref', 'fb_source',
                '_openstat', 'yclid', 'sr_redirect', 'utm_referrer',
                'utm_brand', 'utm_mailing', 'utm_position', 'utm_reader',
                'utm_social', 'utm_social-type', 'utm_topic', 'wt_mc_o'
            ];

            // 移除跟踪参数
            paramsToRemove.forEach(param => {
                urlObj.searchParams.delete(param);
            });

            return urlObj.toString();
        } catch (e) {
            console.error('Error cleaning URL:', e);
            return url;
        }
    }

