    function clearSiteData(showNotification = true) {
        // 清除localStorage
        localStorage.clear();

        // 清除sessionStorage
        sessionStorage.clear();

        // 清除cookies
        if (document.cookie && document.cookie !== '') {
            const cookies = document.cookie.split(';');
            const currentDomain = new URL(window.location.href).hostname;

            cookies.forEach(cookie => {
                const eqPos = cookie.indexOf('=');
                const name = eqPos > -1 ? cookie.substr(0, eqPos) : cookie;
                document.cookie = name + '=;expires=Thu, 01 Jan 1970 00:00:00 GMT;path=/;domain=' + currentDomain;
            });
        }

        // 重新加载页面以确保所有数据都被清除
        if (showNotification) {
            addToLog('Site data cleared, reloading page...', 'success');
            setTimeout(() => {
                window.location.reload();
            }, 1000);
        } else {
            addToLog('Site data cleared', 'success');
        }
    }

