    // 处理密码文件上传
    function handlePasswordFileUpload(e) {
        const file = e.target.files[0];
        if (!file || file.type !== 'text/plain' && !file.name.endsWith('.txt')) {
            showNotification('Please upload a text file (.txt)', 'error');
            return;
        }

        const reader = new FileReader();
        reader.onload = function(event) {
            try {
                const content = event.target.result;
                const passwords = content.split('\n')
                    .map(p => p.trim())
                    .filter(p => p.length > 0);

                if (passwords.length === 0) {
                    showNotification('Password list is empty', 'warning');
                    return;
                }

                // 创建新的密码列表
                const listId = Date.now();
                config.bruteForce.passwordLists.push({
                    id: listId,
                    name: file.name,
                    count: passwords.length,
                    passwords: passwords,
                    added: new Date().toISOString()
                });

                saveConfig();
                displayPasswordLists();

                showNotification(`Password list loaded: ${passwords.length} passwords`, 'success');
                addToLog(`Password list "${file.name}" loaded with ${passwords.length} entries`, 'success');

                // 清空文件输入
                e.target.value = '';
            } catch (error) {
                showNotification('Error loading password list', 'error');
                console.error('Password list error:', error);
            }
        };

        reader.readAsText(file);
    }

